Actionscript.script:
function 拼刀检测()
{
   if(已拼刀 == false)
   {
      for(each in _root.gameworld)
      {
         if(_parent.是否为敌人 != _root.gameworld[each].是否为敌人)
         {
            if(Math.abs(_parent.Z轴坐标 - _root.gameworld[each].Z轴坐标) < 50)
            {
               if(_root.gameworld[each].man.刀.hitTest(this.刀) == true)
               {
                  已拼刀 = true;
                  if(_parent._x < _root.gameworld[each]._x)
                  {
                     拼刀坐标X = Math.floor(_parent._x + Math.abs(_parent._x - _root.gameworld[each]._x) / 2);
                  }
                  else
                  {
                     拼刀坐标X = Math.floor(_parent._x - Math.abs(_parent._x - _root.gameworld[each]._x) / 2);
                  }
                  拼刀坐标Y = _parent._y - random(120);
                  _root.效果("拼刀火花",拼刀坐标X,拼刀坐标Y,100);
                  _parent.硬直(_parent.man,_root.钝感硬直时间);
               }
            }
         }
      }
   }
}
已拼刀 = false;
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      if(Key.isDown(_root.右键) == true)
      {
         _parent.移动("右",快速度);
      }
      else
      {
         _parent.移动("右",慢速度);
      }
   }
   else if(_parent.方向 == "左")
   {
      if(Key.isDown(_root.左键) == true)
      {
         _parent.移动("左",快速度);
      }
      else
      {
         _parent.移动("左",慢速度);
      }
   }
}
